import * as React from 'react';
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import ButtonBase from '@mui/material/ButtonBase';

const Img = styled('img')({
  margin: 'auto',
  display: 'block',
  maxWidth: '100%',
  maxHeight: '100%',
});


const MyFoodlogs = ({qty,Unit,food,Calories,date,isUser,id}) => {

  return (
  
    <Paper
    sx={{
      p: 2,
      margin: 'auto',
      maxWidth: 500,
      flexGrow: 1,
      backgroundColor: (theme) =>
        theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    }}
  >
    <Grid container spacing={2}>
      <Grid item>
        <ButtonBase sx={{ width: 128, height: 128 }}>
          <Img alt="complex" src="https://img.taste.com.au/1jyDeGmD/w720-h480-cfill-q80/taste/2018/12/broccoli-steaks-with-roasted-chickpeas-tomatoes-and-cashew-dressing-144935-2.jpg" />
        </ButtonBase>
      </Grid>
      <Grid item xs={12} sm container>
        <Grid item xs container direction="column" spacing={2}>
          <Grid item xs>
            <Typography gutterBottom variant="subtitle1" component="div">
              {food}
            </Typography>
            <Typography variant="body2" gutterBottom>
             {qty}{Unit} 
            </Typography>
            <Typography variant="body2" color="text.secondary">
             {Calories} Calories
             {date}
            </Typography>
          </Grid>
          <Grid item>
            <Typography sx={{ cursor: 'pointer' }} variant="body2">
              Remove
            </Typography>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  </Paper>
    
  )
}

export default MyFoodlogs;
